import React from 'react';
import styled from 'styled-components';


class Products extends React.Component {
  render() {
    return(
      <React.StrictMode>
        <div>
          <TITLE>Products</TITLE>
        </div>
      </React.StrictMode>
    );
  }
}

const TITLE = styled.h1`
  font-size: 14px;
  font-weight: normal;
`;

export default Products;
